INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (221603168306,'Gouden Dukaat Gelderland 1803 PCGS:XF45 Uiterst Zeldzaam (R4)',22827,'3535HS','Nederland','NL','willemsdaalders','2750.0','EUR','','img221603168306.jpg','<font face="Arial" size="2">Uiterst zeldzame Gouden Dukaat 1803, Bataafse&nbsp;Republiek, Geslagen te Gelderland&nbsp;</font><span style="font-family: -apple-system-font; font-size: 12px; line-height: 16px;">(Fr.319, Sch.18A). met een onbekende oplage (slechts enkele)</span><div><font face="Arial" size="2"><br></font></div><div><font face="Arial" size="2">De munt is door PCGS gecertificeerd als XF45 (ruim zeer fraai), en is hiermee de enige gecertificeerde munt van dit jaar/type, er is dan ook vrijwel niks over deze munt online te vinden. Met uitzondering van dit exemplaar, is dit jaartal/type de afgelopen 10+ jaar niet aangeboden bij de bekende grote veilinghuizen. Een buitenkans om een vrijwel unieke munt aan uw collectie toe te voegen.</font></div><div><font face="Arial" size="2"><br></font></div><div><font face="Arial" size="2">Cataloguswaarde Muntalmanak 2014 (pag. 28.&nbsp;Gelderland): ZF: 3000, P:4500</font></div><div><font face="Arial" size="2"><br></font></div><div><font face="Arial" size="2">De munt wordt alleen als verzekerd pakket verzonden (verzekerd tot een waarde van 5500 euro) uiteraard met trackings-code, vandaar dat de verzendkosten wat hoger uitvallen (inclusief doos). Betaling binnen Nederland uitsluitend via bank-overschrijving.</font></div><div><font face="Arial" size="2"><br></font></div><div><font face="Arial" size="2">----- ----- ----- ----- -----</font></div><div><font face="Arial" size="2"><br></font></div><div><div style="font-family: -apple-system-font; font-size: 12px; line-height: 16px;"><font face="Arial" size="2">Gold Ducat 1803, Batavian republic, struck in the province of Gelderland in 1803 (Fr.319, Sch.18A), with an unknown amount minted (only a few).</font><div><br></div><div><font face="Arial" size="2">The rarest gold ducat struck in this period, and the only one available on the open market (after checking the archives of large international and dutch auction houses I can&nbsp;confidently&nbsp;state that) this is the only coin of this year/type that has been offered in a decade+. A very rare coin, a great addition to any serious collection.</font></div><div><font face="Arial" size="2"><br></font></div><div><font face="Arial" size="2">Graded XF45 by PCGS (recently graded, the only one graded by any service).</font></div><div><br></div><div>Catalogue value (muntcatalogus 2014): XF starts at&nbsp;<font face="Arial" size="2">3750 dollars.</font></div><div><br></div><div><font face="Arial" size="2">This coin will be shipped from the Netherlands, as a package, fully insured (up to 5500 euros, 6800 dollars). International buyers are responsible for any import fees/taxes that may apply, payment via Paypal available for International bidders only.</font></div></div></div>')
