 to the dates of the saving pot, the silver coins and the house, it is 
more then reasonable to assume, that the house was from a former VOC 
dutch rich salesman and stayed in generations for more then 250 years, 
where suddenly during worldwar 2 the adding of coins stopped.<br>Proberby the house is then abandonned or the owners got be deported or even killed. <br><br>Very
 rare is the presence of the 1842 us dollar. It can be explaned, since 
the dutch VOC not only went to the east, but also to the west ( amerika )
 some relative (s) came to visit Batavia once end 1800''s and bring it to
 here. As we all know, the now a days New York was named before New 
Amsterdam during the coloniasation. So proberby some relative bring it 
to Batavia then.<br><br>The found is reported to local authorities and is fully legal.<br><br>Since
 i have nothing with coins, i just random checked the value what simular
