r banktransfer payments.</font>&nbsp;<u>If you can only pay with PayPal please contact me before bidding!</u></font></font></font></p><p style="font-family: Arial; font-size: small;"><font size="1"><font face="Trebuchet MS"><font color="#fb0034"><u><font color="#000000"><b><font size="4">Please wait for your invoice and for every additional coin €0,40 will be added for postalcosts.</font></b></font></u></font></font></font><br></p><p style="font-family: Arial; font-size: small;"><font size="1"><font color="#fb0034"><font face="Trebuchet MS"><font color="#000000">-  Mehrere Objekten welche innerhalb 3 Tagen gewonnen sind werden  kombiniert um Versandkosten zu sparen. Standard Versandkosten ab €2,20  nur mit&nbsp;Zahlung durch&nbsp;Banküberweisung.</font>&nbsp;<u>Melden Sie sich vor dem Bieten, wenn Sie nur mit Paypal zahlen können!</u></font></font></font></p><font size="1"><font face="Trebuchet MS"><font color="#fb0034"><u><font color="#000000"><b><font size="4">Bitte warte für ihre Rechnung und für jedem extra Munze wird €0,40 gerechnet für Versand- und Packungskosten.</font></b></font></u></font></font></font></font>')
